import { useState } from 'react';
import { Link } from 'react-router-dom';
import dashboard_icon from '../../dashboard_icon.png'

export default function DashboardHeader() {
  return (
    <>
      <nav className='flex items-center justify-between sticky top-0 z-10 shadow'>
        <div>
          <Link to="/dashboard">
            <img className="h-12" src={dashboard_icon} alt="アイコン" />
          </Link>
        </div>
      </nav>

      {state.signupModalIsOpen ? <Modal child={<SignupForm />} onClick={handleClickSignup} /> : null}
      {state.loginModalIsOpen ? <Modal child={<LoginForm />} onClick={handleClickLogin} /> : null}
    </>
  );
}
